import { NavLink } from "react-router-dom";
import { FaCalculator, FaHistory, FaUser, FaUsers } from "react-icons/fa";

export default function BottomNav({ role }) {
  return (
    <div className="bottom-nav">
      {role === "patient" && (
        <>
          <NavLink to="/">
            <FaCalculator />
            <div>Калькулятор</div>
          </NavLink>

          <NavLink to="/history">
            <FaHistory />
            <div>История</div>
          </NavLink>

          <NavLink to="/profile">
            <FaUser />
            <div>Профиль</div>
          </NavLink>
        </>
      )}

      {role === "doctor" && (
        <NavLink to="/">
          <FaUsers />
          <div>Пациенты</div>
        </NavLink>
      )}
    </div>
  );
}
